import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navmenu from './components/Navmenu';

export default function App() {
  return (
    <>
      <Router>
        <Navmenu />
        <Switch>
          <Route exact="" path="/">Home</Route>
        </Switch>
      </Router>
    </>
  );
}
